genome = ''

def minskew(genome):
#identifies the position of minimum skew (high C, low G) where OriC is likely
#located
    skew = 0
    skew_list = [0]
    min_skew_list = []

    for nucleotide in genome:
        if nucleotide == 'C':
            skew -= 1
        elif nucleotide == 'G':
            skew += 1
        skew_list.append(skew)

    min_skew = min(skew_list)

    for i in range(len(skew_list)):
        if skew_list[i] == min_skew:
            min_skew_list.append(i)

    return min_skew_list

print(minskew(genome))